import React from 'react';
import {data} from "./store/store.jsx"
import logo from './logo.svg';
import './App.css';

let newTitle = data.map((title) => (title.title));

class App extends React.Component{
  constructor (){
      super();

      this.state = {
          qty: data
      }
  }
    //let newTitle = this.state.qty.map((title) => (title.title));
  render() {
      console.log(this)
    return (
        <div className="App">
          <header className="App-header">
              <div>{this.state.qty
                  .map(function(title){
                      return <div>{title.title}</div>
                  })};
              </div>
          </header>
        </div>
    );
  }
}


export default App;
